// App.js
import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createDrawerNavigator } from '@react-navigation/drawer';
import { ThemeProvider } from './TemaContext'; // Importa el proveedor de contexto
import ConfiguracionUsuario from './configuracion_usuario';
import Categorias from './categorias';

const Drawer = createDrawerNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <ThemeProvider> {/* Envuelve tu navegaci√≥n con el ThemeProvider */}
        <Drawer.Navigator initialRouteName="Inicio">
          <Drawer.Screen name="Inicio" component={Categorias} />
          <Drawer.Screen name="Configuracion" component={ConfiguracionUsuario} />
        </Drawer.Navigator>
      </ThemeProvider>
    </NavigationContainer>
  );
}
